import React from "react";
import { Layout } from "antd";

const InformationContent = () => {
  return (
    <Layout.Content style={{ margin: "2em 16px" }}>
      <div style={{ background: "#fff", padding: 24, minHeight: 280 }}></div>
    </Layout.Content>
  );
};

export default InformationContent;
